function: "Kindorf, Unistrut, SuperStrut, Metstrut, Strut Channel.  It's the same stuff around the world.\r\n\r\nIn the US it's called:\r\n\r\n1 5/8 x 1 5/8 square with 9/16 holes that are 1 7/8 inch apart\r\n\r\nThe rest of the world it's called:\r\n\r\n41mm x 41mm with 14mm holes that are 47.5mm apart.\r\n\r\nAll built to the same international standard, managed at http://www.unistrut.org/\r\n\r\nThese are the solid files for HeeksCAD, and an STL.  Great for making bots."
